/* ─── Glowing Card component for Tech section ─── */
function GlowCard({ children, glowColor = "#11a69b", className = "" }) {
  const [mouse, setMouse] = useState({ x: 0, y: 0 });
  const [hovering, setHovering] = useState(false);
  const ref = useRef(null);
  const handleMove = (e) => {
    if (!ref.current) return;
    const rect = ref.current.getBoundingClientRect();
    setMouse({ x: e.clientX - rect.left, y: e.clientY - rect.top });
  };
  return (
    <div ref={ref} className={`relative group ${className}`}
      onMouseMove={handleMove} onMouseEnter={() => setHovering(true)} onMouseLeave={() => setHovering(false)}>
      {hovering && (
        <div className="absolute inset-0 rounded-3xl pointer-events-none transition-opacity duration-500" style={{
          background: `radial-gradient(400px circle at ${mouse.x}px ${mouse.y}px, ${glowColor}18, transparent 60%)`,
          opacity: hovering ? 1 : 0,
        }} />
      )}
      {children}
    </div>
  );
}

