/* ─── Mexico Map SVG (Simplified) ─── */
function MexicoMap({ offices, activeOffice, setActiveOffice }) {
  /* Simplified Mexico outline — uses a viewBox mapped to approximate lat/lng */
  const mapToSvg = (lat, lng) => {
    const x = ((lng + 118) / 30) * 800;
    const y = ((33 - lat) / 16) * 450;
    return { x, y };
  };
  return (
    <div className="relative w-full" style={{ maxWidth: 560 }}>
      <svg viewBox="0 0 800 450" className="w-full" style={{ filter: "drop-shadow(0 4px 20px rgba(17,166,155,0.15))" }}>
        {/* Mexico outline simplified path */}
        <path d="M30,35 L120,15 L200,18 L260,50 L330,45 L380,20 L440,35 L500,70 L530,100 L560,90 L600,110 L640,140 L680,160 L720,210 L740,260 L760,300 L730,330 L690,350 L640,360 L590,380 L530,390 L480,400 L430,410 L380,400 L340,380 L300,350 L260,320 L230,290 L200,250 L170,220 L140,200 L110,170 L80,140 L50,110 L30,70 Z"
          fill="rgba(17,166,155,0.06)" stroke="rgba(17,166,155,0.25)" strokeWidth="1.5" />
        {/* Connection lines between offices */}
        {offices.filter(o => o.type === "main").map((o, i) => {
          const pos = mapToSvg(o.lat, o.lng);
          return offices.filter(c => c.type === "colab").map((c, j) => {
            const cPos = mapToSvg(c.lat, c.lng);
            return <line key={`${i}-${j}`} x1={pos.x} y1={pos.y} x2={cPos.x} y2={cPos.y}
              stroke={`${TEAL}15`} strokeWidth="0.8" strokeDasharray="4,4" />;
          });
        })}
        {/* Office dots */}
        {offices.map((o, i) => {
          const pos = mapToSvg(o.lat, o.lng);
          const isMain = o.type === "main";
          const isActive = activeOffice === i;
          return (
            <g key={i} className="cursor-pointer" onClick={() => setActiveOffice(isActive ? null : i)}>
              {/* Pulse ring for main offices */}
              {isMain && (
                <circle cx={pos.x} cy={pos.y} r={isActive ? 18 : 12} fill="none"
                  stroke={TEAL} strokeWidth="1" opacity={isActive ? 0.6 : 0.3}
                  style={{ animation: "pulse 2s ease-in-out infinite", transformOrigin: `${pos.x}px ${pos.y}px` }} />
              )}
              <circle cx={pos.x} cy={pos.y} r={isMain ? 7 : 5}
                fill={isActive ? TEAL : isMain ? NAVY : `${TEAL}88`}
                stroke={isActive ? "#fff" : isMain ? TEAL : "transparent"}
                strokeWidth={isActive ? 2.5 : isMain ? 1.5 : 0}
                style={{ transition: "all 0.3s ease", cursor: "pointer" }} />
              <text x={pos.x} y={pos.y - (isMain ? 14 : 10)} textAnchor="middle"
                fill={isActive ? "#fff" : isMain ? "#e2e8f0" : "#94a3b8"}
                fontSize={isActive ? "12" : "10"} fontWeight={isActive ? "700" : "500"}
                fontFamily="'DM Sans', sans-serif"
                style={{ transition: "all 0.3s ease" }}>
                {o.city}
              </text>
            </g>
          );
        })}
      </svg>
      <style>{`@keyframes pulse { 0%,100% { opacity:0.3; transform: scale(1); } 50% { opacity:0.6; transform: scale(1.3); } }`}</style>
    </div>
  );
}

